import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Menu from  './componentes/Menu';
import Home from "./paginas/Home";
import { Container } from "react-bootstrap";

function App() {
  return (
    <div className="App">
    <Menu/>
    <Container>
      <Home/>
    </Container>  
    </div>
  );
}

export default App;
